(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[53338],{53338:n=>{n.exports='\x3c!-- Ignore this part, it is only here to position drawer inside the example block --\x3e\n<div class="custom-portal"><ng-container #viewContainer /></div>\n<header tuiNavigationHeader>\n    <button\n        title="Menu"\n        tuiIconButton\n        tuiNavigationDrawer\n        type="button"\n        [(open)]="open"\n    >\n        <tui-data-list>\n            <tui-opt-group\n                *ngFor="let group of drawer | keyvalue"\n                [label]="group.key"\n            >\n                <button\n                    *ngFor="let item of group.value"\n                    tuiOption\n                    type="button"\n                    (click)="open = false"\n                >\n                    <img\n                        alt="icon"\n                        [src]="item.icon"\n                    />\n                    {{ item.name }}\n                </button>\n            </tui-opt-group>\n            <tui-opt-group>\n                <label tuiOption>\n                    <input\n                        size="s"\n                        tuiSwitch\n                        type="checkbox"\n                        [(ngModel)]="switch"\n                    />\n                    Dark mode\n                </label>\n            </tui-opt-group>\n        </tui-data-list>\n    </button>\n    <span tuiNavigationLogo>\n        <tui-icon icon="@tui.home" />\n        <span tuiFade>A very very long product name</span>\n        <tui-badge>Test</tui-badge>\n    </span>\n    <span tuiNavigationSegments>\n        <button\n            appearance="secondary-grayscale"\n            tuiButton\n            type="button"\n        >\n            Link 1\n        </button>\n        <button\n            appearance="secondary-grayscale"\n            tuiButton\n            type="button"\n        >\n            Link 2\n        </button>\n        <button\n            appearance="secondary-grayscale"\n            tuiButton\n            tuiChevron\n            tuiDropdownOpen\n            type="button"\n            [tuiDropdown]="products"\n        >\n            <span\n                [style.overflow]="\'hidden\'"\n                [style.text-overflow]="\'ellipsis\'"\n            >\n                A very very long project\n            </span>\n            <ng-template #products>\n                <tui-data-list size="s">\n                    <button\n                        tuiOption\n                        type="button"\n                    >\n                        A very very long project\n                        <tui-icon\n                            icon="@tui.check"\n                            [style.font-size.em]="1"\n                            [style.margin-left.rem]="0.5"\n                        />\n                    </button>\n                    <button\n                        tuiOption\n                        type="button"\n                    >\n                        Something else\n                    </button>\n                </tui-data-list>\n            </ng-template>\n        </button>\n    </span>\n    <hr />\n    <button\n        appearance="secondary-grayscale"\n        iconStart="@tui.plus"\n        tuiButton\n        type="button"\n    >\n        Create\n    </button>\n    <button\n        iconStart="@tui.bell"\n        tuiIconButton\n        type="button"\n    >\n        Notifications\n        <tui-badge-notification />\n    </button>\n    <button\n        iconStart="@tui.ellipsis"\n        tuiIconButton\n        type="button"\n    >\n        More\n    </button>\n    <tui-avatar src="AI" />\n</header>\n<div [style.display]="\'flex\'">\n    <aside\n        [style.height.rem]="27"\n        [tuiNavigationAside]="expanded()"\n    >\n        <header>\n            <button\n                iconStart="@tui.home"\n                tuiAsideItem\n                type="button"\n            >\n                <span tuiFade>A very very long product name</span>\n            </button>\n        </header>\n        <button\n            iconStart="@tui.search"\n            tuiAsideItem\n            type="button"\n        >\n            Search\n\n            <ng-container *ngIf="expanded()">\n                <tui-badge appearance="accent">12</tui-badge>\n            </ng-container>\n        </button>\n        <a\n            iconStart="@tui.users"\n            tuiAsideItem\n            [routerLink]="routes.Navigation"\n        >\n            Groups\n        </a>\n        <tui-aside-group>\n            <button\n                automation-id="setting"\n                iconStart="@tui.settings"\n                tuiAsideItem\n                tuiChevron\n                type="button"\n            >\n                Settings\n                <ng-template>\n                    <button\n                        tuiAsideItem\n                        type="button"\n                    >\n                        Account\n                    </button>\n                    <button\n                        tuiAsideItem\n                        type="button"\n                    >\n                        Notifications\n                    </button>\n                    <button\n                        tuiAsideItem\n                        type="button"\n                    >\n                        Privacy\n                    </button>\n                </ng-template>\n            </button>\n        </tui-aside-group>\n        <button\n            automation-id="hint"\n            iconStart="@tui.heart"\n            tuiAsideItem\n            type="button"\n        >\n            <span tuiFade>By default ellipsis is used but you can use fade too</span>\n        </button>\n        <button\n            iconEnd="@tui.chevron-right"\n            iconStart="@tui.ellipsis"\n            tuiAsideItem\n            tuiDropdownHover\n            tuiDropdownOpen\n            type="button"\n            [tuiDropdown]="more"\n        >\n            More\n            <ng-template\n                #more\n                let-close\n            >\n                <tui-data-list tuiDataListDropdownManager>\n                    <button\n                        iconStart="@tui.pencil"\n                        tuiAsideItem\n                        type="button"\n                    >\n                        Write\n                    </button>\n                    <button\n                        iconStart="@tui.pie-chart"\n                        tuiAsideItem\n                        type="button"\n                        [tuiDropdown]="submenu"\n                    >\n                        Categories\n                        <ng-template #submenu>\n                            <tui-data-list>\n                                <button\n                                    tuiAsideItem\n                                    type="button"\n                                    (click)="close()"\n                                >\n                                    Fiction (will close menu)\n                                </button>\n                                <button\n                                    tuiAsideItem\n                                    type="button"\n                                >\n                                    Non-Fiction\n                                </button>\n                                <button\n                                    tuiAsideItem\n                                    type="button"\n                                >\n                                    Children\n                                </button>\n                            </tui-data-list>\n                        </ng-template>\n                    </button>\n                </tui-data-list>\n            </ng-template>\n        </button>\n        <hr />\n        <button\n            iconStart="@tui.plus"\n            tuiAsideItem\n            type="button"\n        >\n            Add\n        </button>\n        <footer>\n            <button\n                iconStart="@tui.star"\n                tuiAsideItem\n                type="button"\n            >\n                Favorites\n            </button>\n            <button\n                tuiAsideItem\n                type="button"\n                [iconStart]="expanded() ? \'@tui.chevron-left\' : \'@tui.chevron-right\'"\n                (click)="handleToggle()"\n            >\n                {{ expanded() ? \'Collapse\' : \'Expand\' }}\n            </button>\n        </footer>\n    </aside>\n    <main tuiNavigationMain>\n        <nav\n            compact\n            tuiSubheader\n            [style.position]="\'sticky\'"\n        >\n            <tui-breadcrumbs [itemsLimit]="10">\n                <ng-container *ngFor="let item of breadcrumbs; let last = last">\n                    <ng-container *ngIf="last">\n                        <strong\n                            *tuiItem\n                            tuiFade\n                        >\n                            {{ item }}\n                        </strong>\n                    </ng-container>\n                    <ng-container *ngIf="!last">\n                        <button\n                            *tuiItem\n                            tuiLink\n                            type="button"\n                        >\n                            {{ item }}\n                        </button>\n                    </ng-container>\n                </ng-container>\n            </tui-breadcrumbs>\n            <tui-tabs tuiFade>\n                <button\n                    tuiTab\n                    type="button"\n                >\n                    Default view\n                </button>\n                <button\n                    tuiTab\n                    type="button"\n                >\n                    Details\n                </button>\n                <button\n                    tuiTab\n                    type="button"\n                >\n                    Followers\n                </button>\n            </tui-tabs>\n            <button\n                appearance="secondary"\n                tuiButton\n                type="button"\n            >\n                Secondary\n            </button>\n            <button\n                tuiButton\n                type="button"\n            >\n                Primary\n            </button>\n        </nav>\n        <ng-container *tuiRepeatTimes="let index of 10">\n            <form\n                tuiAppearance="floating"\n                tuiCardLarge\n                tuiForm="m"\n                [style.grid-column]="\'2 / span 7\'"\n                [style.margin-top.rem]="1"\n            >\n                <header tuiHeader>\n                    <h2 tuiTitle>\n                        Registration form\n                        <span tuiSubtitle>Tell us about yourself</span>\n                    </h2>\n                </header>\n                <tui-textfield>\n                    <label tuiLabel>Name</label>\n                    <input\n                        placeholder="John Wick"\n                        tuiTextfield\n                    />\n                </tui-textfield>\n                <footer>\n                    <button\n                        appearance="secondary"\n                        tuiButton\n                        type="button"\n                    >\n                        Cancel\n                    </button>\n                    <button\n                        tuiButton\n                        type="submit"\n                    >\n                        Ok\n                    </button>\n                </footer>\n            </form>\n            <div\n                tuiAppearance="outline-grayscale"\n                tuiCardLarge\n                [style.grid-column]="\'span 3\'"\n                [style.margin-top.rem]="1"\n            >\n                <h2 tuiTitle>\n                    Sidebar content\n                    <span tuiSubtitle>Use CSS grid to position</span>\n                </h2>\n            </div>\n        </ng-container>\n    </main>\n</div>\n'}}]);